import React from 'react';
import Block from'../../Block/Block';
import { BrowserRouter, Route, Link, Switch } from 'react-router-dom';
var Ons = require('onsenui');
var ROns = require('react-onsenui');

class Main extends React.Component {
    
    static GetContent(navigator)
    {
      const key = 'main';
      const title = 'главная';
      
      return {
        content: (
          <Route path={"/home"}>
            <Main key={key} title={title} navigator={navigator}/>
          </Route>
        ),
        tab: <ROns.Tab key={key} label={title} />};
    }

    GetTitleBlocks(){
      var arr = ["/hello"]
      return arr.map((val) =>{
        return (
            <Block url={val} navigator={this.props.navigator}/>
        )
      });
    }

    render() {
      return (
        <ROns.Page>
          <ROns.Toolbar style={{'position': 'relative'}}>
            <div className="center"> {this.props.title} </div>
          </ROns.Toolbar>
              {this.GetTitleBlocks()} 
        </ROns.Page>
      );
    }
}

  export default Main
